<p>Karrueche, who's part of the cast of TNT TV show Claws, recently implored her Instagram followers to shop more at black-owned businesses.</p>

<p>'When you shop Black-owned businesses, you are giving a lifeline to many who may be on the brink of closure or bankruptcy,' she captioned a short video.</p>

<p>She said it was 'legit one of the best ways to combat racism.' </p>

