<p>Although much of Hollywood is currently shut down due to the novel coronavirus, Deadline has reported that the actress would be joining the cast of the BET drama Games People Play when it began filming for its second season.</p>

<p>She'll play the daughter of the owners of a fictional LA basketball team who becomes a romantic complication for series lead Sarunas J. Jackson. </p>

<p>The LA native was previously attached to singer Chris Brown, but she currently has a five-year restraining order against her abusive ex, which won't expire until 2023.</p>

<p>She has since moved on to former New York Giants player Victor Cruz, whom she's been dating for the last two years. </p>

